import React from "react";
import { Link } from "react-router-dom";
import {
  PageContainer,
  Title,
  HeadlineContainer,
  Subtitle,
  Demo,
  Video,
  ContentContainer1,
  ContentContainer2,
  ContentContainer3,
  SubContainer,
} from "./styles/index_style.js";
import ReactPlayer from "react-player";
import landing_video from "../imgs/landing_video.mp4";

function Home() {
  return (
    <>
      <PageContainer>
        <Video src={landing_video} autoPlay loop muted playsinline />
        <HeadlineContainer>
          <Title>The Future of Maritime Navigation</Title>
          <Demo to="/contact">Schedule a Demo</Demo>
        </HeadlineContainer>
      </PageContainer>
      <ContentContainer1>
        <SubContainer>
          <Subtitle>Extending the possibilities of radar data</Subtitle>
        </SubContainer>
      </ContentContainer1>
    </>
  );
}

export default Home;
